import React from 'react'
import Nav from '../nav';
const forgottenPassword = () => {
  return (
    <div>
      <Nav />
      <div className='container SignUpFormat'>
      <p></p>
      <input type='Email'/>

      <button className="btn" type="submit">Send Code</button>
      </div>
    </div>
  )
}

export default forgottenPassword
